        a file or file-like object as data.\\n- Allow hooks to return responses that
        indicate errors.\\n- Fix Response.text and Response.json for body-less responses.\\n\\n0.13.0
        (2012-05-29)\\n+++++++++++++++++++\\n\\n- Removal of Requests.async in favor
        of `grequests <https://github.com/kennethreitz/grequests>`_\\n- Allow disabling
        of cookie persistence.\\n- New implementation of safe_mode\\n- cookies.get
        now supports default argument\\n- Session cookies not saved when Session.request
        is called with return_response=False\\n- Env: no_proxy support.\\n- RequestsCookieJar
        improvements.\\n- Various bug fixes.\\n\\n0.12.1 (2012-05-08)\\n+++++++++++++++++++\\n\\n-
        New ``Response.json`` property.\\n- Ability to add string file uploads.\\n-
        Fix out-of-range issue with iter_lines.\\n- Fix iter_content default size.\\n-
        Fix POST redirects containing files.\\n\\n0.12.0 (2012-05-02)\\n+++++++++++++++++++\\n\\n-
        EXPERIMENTAL OAUTH SUPPORT!\\n- Proper CookieJar-backed cookies interface
        with awesome dict-like interface.\\n- Speed fix for non-iterated content chunks.\\n-
        Move ``pre_request`` to a more usable place.\\n- New ``pre_send`` hook.\\n-
        Lazily encode data, params, files.\\n- Load system Certificate Bundle if ``certify``
        isn't available.\\n- Cleanups, fixes.\\n\\n0.11.2 (2012-04-22)\\n+++++++++++++++++++\\n\\n-
        Attempt to use the OS's certificate bundle if ``certifi`` isn't available.\\n-
        Infinite digest auth redirect fix.\\n- Multi-part file upload improvements.\\n-
        Fix decoding of invalid %encodings in URLs.\\n- If there is no content in
        a response don't throw an error the second time that content is attempted
        to be read.\\n- Upload data on redirects.\\n\\n0.11.1 (2012-03-30)\\n+++++++++++++++++++\\n\\n*
        POST redirects now break RFC to do what browsers do: Follow up with a GET.\\n*
        New ``strict_mode`` configuration to disable new redirect behavior.\\n\\n\\n0.11.0
        (2012-03-14)\\n+++++++++++++++++++\\n\\n* Private SSL Certificate support\\n*
        Remove select.poll from Gevent monkeypatching\\n* Remove redundant generator
        for chunked transfer encoding\\n* Fix: Response.ok raises Timeout Exception
        in safe_mode\\n\\n0.10.8 (2012-03-09)\\n+++++++++++++++++++\\n\\n* Generate
        chunked ValueError fix\\n* Proxy configuration by environment variables\\n*
        Simplification of iter_lines.\\n* New `trust_env` configuration for disabling
        system/environment hints.\\n* Suppress cookie errors.\\n\\n0.10.7 (2012-03-07)\\n+++++++++++++++++++\\n\\n*
        `encode_uri` = False\\n\\n0.10.6 (2012-02-25)\\n+++++++++++++++++++\\n\\n*
        Allow '=' in cookies.\\n\\n0.10.5 (2012-02-25)\\n+++++++++++++++++++\\n\\n*
        Response body with 0 content-length fix.\\n* New async.imap.\\n* Don't fail
        on netrc.\\n\\n\\n0.10.4 (2012-02-20)\\n+++++++++++++++++++\\n\\n* Honor netrc.\\n\\n0.10.3
        (2012-02-20)\\n+++++++++++++++++++\\n\\n* HEAD requests don't follow redirects
        anymore.\\n* raise_for_status() doesn't raise for 3xx anymore.\\n* Make Session
        objects picklable.\\n* ValueError for invalid schema URLs.\\n\\n0.10.2 (2012-01-15)\\n+++++++++++++++++++\\n\\n*
        Vastly improved URL quoting.\\n* Additional allowed cookie key values.\\n*
        Attempted fix for \\\"Too many open files\\\" Error\\n* Replace unicode errors
        on first pass, no need for second pass.\\n* Append '/' to bare-domain urls
        before query insertion.\\n* Exceptions now inherit from RuntimeError.\\n*
        Binary uploads + auth fix.\\n* Bugfixes.\\n\\n\\n0.10.1 (2012-01-23)\\n+++++++++++++++++++\\n\\n*
        PYTHON 3 SUPPORT!\\n* Dropped 2.5 Support. (*Backwards Incompatible*)\\n\\n0.10.0
        (2012-01-21)\\n+++++++++++++++++++\\n\\n* ``Response.content`` is now bytes-only.
