        subtypes.\\n* Removal of `decode_unicode`. (*Backwards Incompatible*)\\n*
        New multiple-hooks system.\\n* New ``Response.register_hook`` for registering
        hooks within the pipeline.\\n* ``Response.url`` is now Unicode.\\n\\n0.9.3
        (2012-01-18)\\n++++++++++++++++++\\n\\n* SSL verify=False bugfix (apparent
