        https://codecov.io/github/pyca/pyopenssl/branch/master/graph/badge.svg\\n
        \  :target: https://codecov.io/github/pyca/pyopenssl\\n   :alt: Test coverage\\n\\n\\nHigh-level
        wrapper around a subset of the OpenSSL library.  Includes\\n\\n* ``SSL.Connection``
        objects, wrapping the methods of Python's portable sockets\\n* Callbacks written
        in Python\\n* Extensive error-handling mechanism, mirroring OpenSSL's error
        codes\\n\\n... and much more.\\n\\nYou can find more information in the documentation_.\\nDevelopment
        takes place on GitHub_.\\n\\n\\nDiscussion\\n==========\\n\\nIf you run into
        bugs, you can file them in our `issue tracker`_.\\n\\nWe maintain a cryptography-dev_
        mailing list for both user and development discussions.\\n\\nYou can also
        join ``#cryptography-dev`` on Freenode to ask questions or get involved.\\n\\n\\n..
        _documentation: https://pyopenssl.org/\\n.. _`issue tracker`: https://github.com/pyca/pyopenssl/issues\\n..
        _cryptography-dev: https://mail.python.org/mailman/listinfo/cryptography-dev\\n..
        _GitHub: https://github.com/pyca/pyopenssl\\n\\n\\nRelease Information\\n===================\\n\\n17.3.0
        (2017-09-14)\\n-------------------\\n\\n\\nBackward-incompatible changes:\\n^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^\\n\\n-
        Dropped support for Python 3.3.\\n  `#677 <https://github.com/pyca/pyopenssl/pull/677>`_\\n-
        Removed the deprecated ``OpenSSL.rand`` module.\\n  This is being done ahead
        of our normal deprecation schedule due to its lack of use and the fact that
        it was becoming a maintenance burden.\\n  ``os.urandom()`` should be used
        instead.\\n  `#675 <https://github.com/pyca/pyopenssl/pull/675>`_\\n\\n\\nDeprecations:\\n^^^^^^^^^^^^^\\n\\n-
        Deprecated ``OpenSSL.tsafe``.\\n  `#673 <https://github.com/pyca/pyopenssl/pull/673>`_\\n\\nChanges:\\n^^^^^^^^\\n\\n-
