        version on PyPI\\n\\n.. image:: https://img.shields.io/pypi/l/chardet.svg\\n
        \  :alt: License\\n\\n\\nDetects\\n - ASCII, UTF-8, UTF-16 (2 variants), UTF-32
        (4 variants)\\n - Big5, GB2312, EUC-TW, HZ-GB-2312, ISO-2022-CN (Traditional
        and Simplified Chinese)\\n - EUC-JP, SHIFT_JIS, CP932, ISO-2022-JP (Japanese)\\n
        - EUC-KR, ISO-2022-KR (Korean)\\n - KOI8-R, MacCyrillic, IBM855, IBM866, ISO-8859-5,
        windows-1251 (Cyrillic)\\n - ISO-8859-5, windows-1251 (Bulgarian)\\n - ISO-8859-1,
        windows-1252 (Western European languages)\\n - ISO-8859-7, windows-1253 (Greek)\\n
        - ISO-8859-8, windows-1255 (Visual and Logical Hebrew)\\n - TIS-620 (Thai)\\n\\n..
        note::\\n   Our ISO-8859-2 and windows-1250 (Hungarian) probers have been
        temporarily\\n   disabled until we can retrain the models.\\n\\nRequires Python
        2.6, 2.7, or 3.3+.\\n\\nInstallation\\n------------\\n\\nInstall from `PyPI
        <https://pypi.python.org/pypi/chardet>`_::\\n\\n    pip install chardet\\n\\nDocumentation\\n-------------\\n\\nFor
        users, docs are now available at https://chardet.readthedocs.io/.\\n\\nCommand-line
        Tool\\n-----------------\\n\\nchardet comes with a command-line script which
        reports on the encodings of one\\nor more files::\\n\\n    % chardetect somefile
        someotherfile\\n    somefile: windows-1252 with confidence 0.5\\n    someotherfile:
        ascii with confidence 1.0\\n\\nAbout\\n-----\\n\\nThis is a continuation of
