        false, \n        \"description\": \"Certifi: Python SSL Certificates\\n================================\\n\\n`Certifi`_
        is a carefully curated collection of Root Certificates for\\nvalidating the
        trustworthiness of SSL certificates while verifying the identity\\nof TLS
        hosts. It has been extracted from the `Requests`_ project.\\n\\nInstallation\\n------------\\n\\n``certifi``
        is available on PyPI. Simply install it with ``pip``::\\n\\n    $ pip install
        certifi\\n\\nUsage\\n-----\\n\\nTo reference the installed certificate authority
        (CA) bundle, you can use the\\nbuilt-in function::\\n\\n    >>> import certifi\\n\\n
        \   >>> certifi.where()\\n    '/usr/local/lib/python2.7/site-packages/certifi/cacert.pem'\\n\\nEnjoy!\\n\\n1024-bit
        Root Certificates\\n~~~~~~~~~~~~~~~~~~~~~~~~~~\\n\\nBrowsers and certificate
        authorities have concluded that 1024-bit keys are\\nunacceptably weak for
        certificates, particularly root certificates. For this\\nreason, Mozilla has
        removed any weak (i.e. 1024-bit key) certificate from its\\nbundle, replacing
        it with an equivalent strong (i.e. 2048-bit or greater key)\\ncertificate
        from the same CA. Because Mozilla removed these certificates from\\nits bundle,
        ``certifi`` removed them as well.\\n\\nUnfortunately, old versions of OpenSSL
        (less than 1.0.2) sometimes fail to\\nvalidate certificate chains that use
        the strong roots. For this reason, if you\\nfail to validate a certificate
        using the ``certifi.where()`` mechanism, you can\\nintentionally re-add the
        1024-bit roots back into your bundle by calling\\n``certifi.old_where()``
        instead. This is not recommended in production: if at\\nall possible you should
        upgrade to a newer OpenSSL. However, if you have no\\nother option, this may
        work for you.\\n\\n.. _`Certifi`: http://certifi.io/en/latest/\\n.. _`Requests`:
