        \       \"version\": \"1.0.8\", \n        \"cheesecake_documentation_id\":
        null, \n        \"_pypi_hidden\": false, \n        \"description\": \"pretend\\n=======\\n\\n..
        image:: https://secure.travis-ci.org/alex/pretend.png\\n    :target: https://travis-ci.org/alex/pretend\\n\\nPretend
        is a library to make stubbing with Python easier.\\n\\nWhat is stubbing?\\n-----------------\\n\\nStubbing
        is a technique for writing tests. You may hear the term mixed up with\\nmocks,
        fakes, or doubles. Basically a stub is an object that returns pre-canned\\nresponses,
        rather than doing any computation.\\n\\nMartin Fowler does a good job explaining
        the terms in his `Mocks Aren't Stubs`_\\narticle.\\n\\n.. _`Mocks Aren't Stubs`:
        http://martinfowler.com/articles/mocksArentStubs.html\\n\\nHow do I install
        ``pretend``?\\n-----------------------------\\n\\nIt's easy with ``pip``!\\n\\n..
        code:: bash\\n\\n    $ pip install pretend\\n\\nHow do I use ``pretend``?\\n-------------------------\\n\\nIt's
        easy, the ``stub`` function makes it easy to create a stub:\\n\\n.. code::
        pycon\\n\\n    >>> from pretend import stub\\n    >>> x = stub(country_code=\\\"US\\\")\\n
        \   >>> some_function(x)\\n\\nHere ``x`` will be an object with a single attribute
        ``country_code`` which has\\nthe value ``\\\"US\\\"``. Unlike mocks, ``x``
        will not respond to any other attribute\\nor methods, nor does it have any
        methods for making assertions about what you\\naccessed.\\n\\nIf you want
        to add a method to the stub, simple provide a function to it:\\n\\n.. code::
        pycon\\n\\n    >>> from pretend import stub\\n    >>> x = stub(country_code=lambda:
        \\\"US\\\")\\n    >>> x.country_code()\\n    'US'\\n\\nIt's important to note
        that functions on stubs *do not* take a ``self``\\nargument, this is because
        stubs should be returning pre-canned values, not\\ndoing computations.\\n\\nExceptions
        with ``pretend``\\n---------------------------\\n\\nSometimes a method you
        want to stub doesn't return a value, but instead raises\\nan exception. To
        make this easy, ``pretend`` provides a helper function,\\n``raiser``, it can
        be used like so:\\n\\n.. code:: pycon\\n\\n    >>> from pretend import stub,
        raiser\\n    >>> x = stub(func=raiser(ValueError))\\n    >>> x.func()\\n    Traceback
        (most recent call last):\\n      File \\\"<stdin>\\\", line 1, in <module>\\n
        \     File \\\"pretend.py\\\", line 74, in inner\\n        raise exc\\n    ValueError\\n\\nWhy
        is stubbing better?\\n-----------------------\\n\\nIdeally stubbing tests
        how your system responds to a particular input, rather\\nthan which API is
        used. Stubbing still requires you to write tests that check\\nthe results
        of a computation, rather than looking for side effects. This\\ndoesn't always
        work though, so you do sometimes still need mocking (e.g.\\nsometimes you
        really want to check for a side effect.)\\n\\nHow do I get my stub into place?\\n--------------------------------\\n\\nIf
        you come from other mocking libraries you're probably used to a ``patch``\\nmethod
        to put a mock in place. ``pretend`` doesn't include anything like this,\\na)
        we believe it's better, where possible, to pass stubs as arguments rather\\nthan
        monkey patch them into place, b) we believe that when you do need to\\nmonkey
        patch something into place you should use something provided by your\\ntesting
        tool. ``py.test`` includes `such a tool`_.\\n\\n.. _`such a tool`: http://pytest.org/latest/monkeypatch.html\\n\\nWhat
        if I really need to record the calls?\\n------------------------------------------\\n\\nIf
        you really really need to, ``pretend`` includes a ``call_recorder`` utility:\\n\\n..
        code:: pycon\\n\\n    >>> from pretend import call_recorder, call\\n    >>>
        f = call_recorder(lambda a: a + 2)\\n    >>> f(3)\\n    5\\n    >>> assert
        f.calls == [call(3)]\\n\\nWho wrote this?\\n---------------\\n\\n``pretend``
        is by Alex Gaynor, who was just tired of not having a good stubbing\\ntool
        for Python. The name is from Idan Gazit.\", \n        \"release_url\": \"http://pypi.python.org/pypi/pretend/1.0.8\",
