  response:
    body: {string: "{\n    \"info\": {\n        \"maintainer\": \"\", \n        \"docs_url\":
        null, \n        \"requires_python\": \"\", \n        \"maintainer_email\":
        \"\", \n        \"cheesecake_code_kwalitee_id\": null, \n        \"keywords\":
        \"\", \n        \"package_url\": \"http://pypi.python.org/pypi/sphinx_rtd_theme\",
        \n        \"author\": \"Dave Snider\", \n        \"author_email\": \"dave.snider@gmail.com\",
        \n        \"download_url\": \"\", \n        \"platform\": \"\", \n        \"version\":
        \"0.2.5b1\", \n        \"cheesecake_documentation_id\": null, \n        \"_pypi_hidden\":
        false, \n        \"description\": \".. _readthedocs.org: http://www.readthedocs.org\\n..
        _bower: http://www.bower.io\\n.. _sphinx: http://www.sphinx-doc.org\\n.. _compass:
        http://www.compass-style.org\\n.. _sass: http://www.sass-lang.com\\n.. _wyrm:
        http://www.github.com/snide/wyrm/\\n.. _grunt: http://www.gruntjs.com\\n..
        _node: http://www.nodejs.com\\n.. _demo: http://docs.readthedocs.org\\n..
        _hidden: http://sphinx-doc.org/markup/toctree.html\\n\\n**************************\\nRead
        the Docs Sphinx Theme\\n**************************\\n\\n.. contents:: \\n\\nView
        a working demo_ over on readthedocs.org_.\\n\\nThis is a mobile-friendly sphinx_
        theme I made for readthedocs.org_.\\n\\nIf you'd like to update the theme,\\nplease
        make your edits to the SASS files here,\\nrather than the .css files on checked
        into the repo.\\n\\n.. image:: demo_docs/source/static/screen_mobile.png\\n
        \   :width: 100%\\n\\nInstallation\\n============\\n\\nVia package\\n-----------\\n\\nDownload
        the package or add it to your ``requirements.txt`` file:\\n\\n.. code:: bash\\n\\n
        \   $ pip install sphinx_rtd_theme\\n\\nIn your ``conf.py`` file:\\n\\n..
        code:: python\\n\\n    import sphinx_rtd_theme\\n\\n    html_theme = \\\"sphinx_rtd_theme\\\"\\n\\n
        \   html_theme_path = [sphinx_rtd_theme.get_html_theme_path()]\\n\\nVia git
        or download\\n-------------------\\n\\nSymlink or subtree the ``sphinx_rtd_theme/sphinx_rtd_theme``
        repository into your documentation at\\n``docs/_themes/sphinx_rtd_theme``
        then add the following two settings to your Sphinx\\nconf.py file:\\n\\n..
        code:: python\\n\\n    html_theme = \\\"sphinx_rtd_theme\\\"\\n    html_theme_path
        = [\\\"_themes\\\", ]\\n\\nConfiguration\\n=============\\n\\nYou can configure
        different parts of the theme.\\n\\nProject-wide configuration\\n--------------------------\\n\\nThe
        theme's project-wide options are defined in the ``sphinx_rtd_theme/theme.conf``\\nfile
        of this repository, and can be defined in your project's ``conf.py`` via\\n``html_theme_options``.
        For example:\\n\\n.. code:: python\\n\\n    html_theme_options = {\\n        'collapse_navigation':
        False,\\n        'display_version': False,\\n        'navigation_depth': 3,\\n
        \   }\\n\\nThe following options are available:\\n\\n* ``canonical_url`` This
        will specify a `canonical url <https://en.wikipedia.org/wiki/Canonical_link_element>`__\\n
        \ to let search engines know they should give higher ranking to latest version
        of the docs.\\n  The url points to the root of the documentation and requires
        a trailing slash.\\n\\nPage-level configuration\\n------------------------\\n\\nPages
        support metadata that changes how the theme renders.\\nYou can currently add
        the following:\\n\\n* ``:github_url:`` This will force the \\\"Edit on GitHub\\\"
        to the configured URL\\n* ``:bitbucket_url:`` This will force the \\\"Edit
        on Bitbucket\\\" to the configured URL\\n* ``:gitlab_url:`` This will force
        the \\\"Edit on GitLab\\\" to the configured URL\\n\\nChangelog\\n=========\\n\\nmaster\\n------\\n\\n*
        Include fontawesome-webfont.woff2 in pip package\\n* Updated wyrm_ and Font
        Awesome\\n* Split multiple data types on different lines\\n* Italicize ``.versionmodified``\\n*
        Fix line number spacing to align with the code lines\\n* Hide Edit links on
        auto created pages\\n* Align ``.. centered::`` text to the center\\n* Increase
        contrast for footnotes\\n* Add language to the JS output variable \\n* Include
        the lato italics font with the theme\\n* Fix padding on field lists\\n\\nv0.2.4\\n------\\n\\n*
        Yet another patch to deal with extra builders outside Spinx, such as the\\n
        \ singlehtml builders from the Read the Docs Sphinx extension\\n\\nv0.2.3\\n------\\n\\n*
        Temporarily patch Sphinx issue with ``singlehtml`` builder by inspecting the\\n
        \ builder in template.\\n\\nv0.2.2\\n------\\n\\n* Roll back toctree fix in
        0.2.1 (#367). This didn't fix the issue and\\n  introduced another bug with
        toctrees display.\\n\\nv0.2.1\\n------\\n\\n* Add the ``rel`` HTML attribute
        to the footer links which point to\\n  the previous and next pages.\\n* Fix
        toctree issue caused by Sphinx singlehtml builder (#367)\\n\\nv0.2.0\\n------\\n\\n*
        Adds the ``comments`` block after the ``body`` block in the template\\n* Added
        \\\"Edit on GitLab\\\" support\\n* Many bug fixes\\n\\nv0.1.10-alpha\\n-------------\\n\\n..
        note::\\n    This is a pre-release version\\n\\n* Removes Sphinx dependency\\n*
        Fixes hamburger on mobile display\\n* Adds a ``body_begin`` block to the template\\n*
        Add ``prev_next_buttons_location`` which can take the value ``bottom``,\\n
        \ ``top``, ``both`` , ``None`` and will display the \\\"Next\\\" and \\\"Previous\\\"\\n
        \ buttons accordingly\\n\\nv0.1.9\\n------\\n\\n* Intermittent scrollbar visibility
        bug fixed. This change introduces a\\n  backwards incompatible change to the
        theme's layout HTML. This should only be\\n  a problem for derivative themes
        that have overridden styling of nav elements\\n  using direct decendant selectors.
        See `#215`_ for more information.\\n* Safari overscroll bug fixed\\n* Version
        added to the nav header\\n* Revision id was added to the documentation footer
        if you are using RTD\\n* An extra block, ``extrafooter`` was added to allow
        extra content in the\\n  document footer block\\n* Fixed modernizr URL\\n*
        Small display style changes on code blocks, figure captions, and nav elements\\n\\n..
        _#215: https://github.com/snide/sphinx_rtd_theme/pull/215\\n\\nv0.1.8\\n------\\n\\n*
        Start keeping changelog :)\\n* Support for third and fourth level headers
        in the sidebar\\n* Add support for Sphinx 1.3\\n* Add sidebar headers for
        :caption: in Sphinx toctree\\n* Clean up sidebar scrolling behavior so it
        never scrolls out of view\\n\\nHow the Table of Contents builds\\n================================\\n\\nCurrently
        the left menu will build based upon any ``toctree(s)`` defined in your index.rst
        file.\\nIt outputs 2 levels of depth, which should give your visitors a high
        level of access to your\\ndocs. If no toctrees are set the theme reverts to
        sphinx's usual local toctree.\\n\\nIt's important to note that if you don't
        follow the same styling for your rST headers across\\nyour documents, the
        toctree will misbuild, and the resulting menu might not show the correct\\ndepth
        when it renders.\\n\\nAlso note that the table of contents is set with ``includehidden=true``.
        This allows you\\nto set a hidden toc in your index file with the hidden_
        property that will allow you\\nto build a toc without it rendering in your
        index.\\n\\nBy default, the navigation will \\\"stick\\\" to the screen as
        you scroll. However if your toc\\nis vertically too large, it will revert
        to static positioning. To disable the sticky nav\\naltogether change the setting
        in ``conf.py``.\\n\\nContributing or modifying the theme\\n===================================\\n\\nThe
        sphinx_rtd_theme is primarily a sass_ project that requires a few other sass
        libraries. I'm\\nusing bower_ to manage these dependencies and sass_ to build
        the css. The good news is\\nI have a very nice set of grunt_ operations that
        will not only load these dependencies, but watch\\nfor changes, rebuild the
        sphinx demo docs and build a distributable version of the theme.\\nThe bad
        news is this means you'll need to set up your environment similar to that\\nof
        a front-end developer (vs. that of a python developer). That means installing
        node and ruby.\\n\\nSet up your environment\\n-----------------------\\n\\n1.
        Install sphinx_ into a virtual environment.\\n\\n.. code::\\n\\n    pip install
        sphinx\\n\\n2. Install sass\\n\\n.. code::\\n\\n    gem install sass\\n\\n2.
        Install node, bower and grunt.\\n\\n.. code::\\n\\n    // Install node\\n
        \   brew install node\\n\\n    // Install bower and grunt\\n    npm install
        -g bower grunt-cli\\n\\n    // Now that everything is installed, let's install
        the theme dependecies.\\n    npm install\\n\\nNow that our environment is
        set up, make sure you're in your virtual environment, go to\\nthis repository
        in your terminal and run grunt:\\n\\n.. code::\\n\\n    grunt\\n\\nThis default
        task will do the following **very cool things that make it worth the trouble**.\\n\\n1.
        It'll install and update any bower dependencies.\\n2. It'll run sphinx and
        build new docs.\\n3. It'll watch for changes to the sass files and build css
        from the changes.\\n4. It'll rebuild the sphinx docs anytime it notices a
        change to .rst, .html, .js\\n   or .css files.\\n\\nBefore you create an issue\\n--------------------------\\n\\nI
        don't have a lot of time to maintain this project due to other responsibilities.\\nI
        know there are a lot of Python engineers out there that can't code sass /
        css and\\nare unable to submit pull requests. That said, submitting random
        style bugs without\\nat least providing sample documentation that replicates
        your problem is a good\\nway for me to ignore your request. RST unfortunately
        can spit out a lot of things\\nin a lot of ways. I don't have time to research
        your problem for you, but I do\\nhave time to fix the actual styling issue
        if you can replicate the problem for me.\\n\\nTODO\\n====\\n\\n* Separate
        some sass variables at the theme level so you can overwrite some basic colors.\\n\",
