        uses reStructuredText as its markup language, and many of its strengths\\ncome
        from the power and straightforwardness of reStructuredText and its parsing\\nand
        translating suite, the Docutils.\\n\\nAmong its features are the following:\\n\\n*
        Output formats: HTML (including derivative formats such as HTML Help, Epub\\n
