        Status](https://secure.travis-ci.org/martinblech/xmltodict.png)](http://travis-ci.org/martinblech/xmltodict)\\n\\n```python\\n>>>
        print(json.dumps(xmltodict.parse(\\\"\\\"\\\"\\n...  <mydocument has=\\\"an
        attribute\\\">\\n...    <and>\\n...      <many>elements</many>\\n...      <many>more
        elements</many>\\n...    </and>\\n...    <plus a=\\\"complex\\\">\\n...      element
        as well\\n...    </plus>\\n...  </mydocument>\\n...  \\\"\\\"\\\"), indent=4))\\n{\\n
        \   \\\"mydocument\\\": {\\n        \\\"@has\\\": \\\"an attribute\\\", \\n
        \       \\\"and\\\": {\\n            \\\"many\\\": [\\n                \\\"elements\\\",
        \\n                \\\"more elements\\\"\\n            ]\\n        }, \\n
        \       \\\"plus\\\": {\\n            \\\"@a\\\": \\\"complex\\\", \\n            \\\"#text\\\":
        \\\"element as well\\\"\\n        }\\n    }\\n}\\n```\\n\\n## Namespace support\\n\\nBy
        default, `xmltodict` does no XML namespace processing (it just treats namespace
        declarations as regular node attributes), but passing `process_namespaces=True`
        will make it expand namespaces for you:\\n\\n```python\\n>>> xml = \\\"\\\"\\\"\\n...
        <root xmlns=\\\"http://defaultns.com/\\\"\\n...       xmlns:a=\\\"http://a.com/\\\"\\n...
        \      xmlns:b=\\\"http://b.com/\\\">\\n...   <x>1</x>\\n...   <a:y>2</a:y>\\n...
        \  <b:z>3</b:z>\\n... </root>\\n... \\\"\\\"\\\"\\n>>> xmltodict.parse(xml,
        process_namespaces=True) == {\\n...     'http://defaultns.com/:root': {\\n...
        \        'http://defaultns.com/:x': '1',\\n...         'http://a.com/:y':
        '2',\\n...         'http://b.com/:z': '3',\\n...     }\\n... }\\nTrue\\n```\\n\\nIt
        also lets you collapse certain namespaces to shorthand prefixes, or skip them
        altogether:\\n\\n```python\\n>>> namespaces = {\\n...     'http://defaultns.com/':
        None, # skip this namespace\\n...     'http://a.com/': 'ns_a', # collapse
        \\\"http://a.com/\\\" -> \\\"ns_a\\\"\\n... }\\n>>> xmltodict.parse(xml, process_namespaces=True,
        namespaces=namespaces) == {\\n...     'root': {\\n...         'x': '1',\\n...
        \        'ns_a:y': '2',\\n...         'http://b.com/:z': '3',\\n...     },\\n...
        }\\nTrue\\n```\\n\\n## Streaming mode\\n\\n`xmltodict` is very fast ([Expat](http://docs.python.org/library/pyexpat.html)-based)
        and has a streaming mode with a small memory footprint, suitable for big XML
        dumps like [Discogs](http://discogs.com/data/) or [Wikipedia](http://dumps.wikimedia.org/):\\n\\n```python\\n>>>
        def handle_artist(_, artist):\\n...     print(artist['name'])\\n...     return
        True\\n>>> \\n>>> xmltodict.parse(GzipFile('discogs_artists.xml.gz'),\\n...
        \    item_depth=2, item_callback=handle_artist)\\nA Perfect Circle\\nFant\\u00f4mas\\nKing
        Crimson\\nChris Potter\\n...\\n```\\n\\nIt can also be used from the command
        line to pipe objects to a script like this:\\n\\n```python\\nimport sys, marshal\\nwhile
        True:\\n    _, article = marshal.load(sys.stdin)\\n    print(article['title'])\\n```\\n\\n```sh\\n$
        cat enwiki-pages-articles.xml.bz2 | bunzip2 | xmltodict.py 2 | myscript.py\\nAccessibleComputing\\nAnarchism\\nAfghanistanHistory\\nAfghanistanGeography\\nAfghanistanPeople\\nAfghanistanCommunications\\nAutism\\n...\\n```\\n\\nOr
        just cache the dicts so you don't have to parse that big XML file again. You
        do this only once:\\n\\n```sh\\n$ cat enwiki-pages-articles.xml.bz2 | bunzip2
        | xmltodict.py 2 | gzip > enwiki.dicts.gz\\n```\\n\\nAnd you reuse the dicts
        with every script that needs them:\\n\\n```sh\\n$ cat enwiki.dicts.gz | gunzip
        | script1.py\\n$ cat enwiki.dicts.gz | gunzip | script2.py\\n...\\n```\\n\\n##
        Roundtripping\\n\\nYou can also convert in the other direction, using the
        `unparse()` method:\\n\\n```python\\n>>> mydict = {\\n...     'response':
        {\\n...             'status': 'good',\\n...             'last_updated': '2014-02-16T23:10:12Z',\\n...
        \    }\\n... }\\n>>> print(unparse(mydict, pretty=True))\\n<?xml version=\\\"1.0\\\"
        encoding=\\\"utf-8\\\"?>\\n<response>\\n\\t<status>good</status>\\n\\t<last_updated>2014-02-16T23:10:12Z</last_updated>\\n</response>\\n```\\n\\nText
        values for nodes can be specified with the `cdata_key` key in the python dict,
        while node properties can be specified with the `attr_prefix` prefixed to
        the key name in the python dict. The default value for `attr_prefix` is `@`
        and the default value for `cdata_key` is `#text`.\\n\\n```python\\n>>> import
        xmltodict\\n>>> \\n>>> mydict = {\\n...     'text': {\\n...         '@color':'red',\\n...
        \        '@stroke':'2',\\n...         '#text':'This is a test'\\n...     }\\n...
        }\\n>>> print(xmltodict.unparse(mydict, pretty=True))\\n<?xml version=\\\"1.0\\\"
        encoding=\\\"utf-8\\\"?>\\n<text stroke=\\\"2\\\" color=\\\"red\\\">This is
        a test</text>\\n```\\n\\n## Ok, how do I get it?\\n\\n### Using pypi\\n\\nYou
        just need to\\n\\n```sh\\n$ pip install xmltodict\\n```\\n\\n### RPM-based
