        sudo pacman -S python-xmltodict\\n```\\n\\n### Debian-based distro (Debian,
        Ubuntu, \\u2026)\\n\\nThere is an [official Debian package for xmltodict](https://tracker.debian.org/pkg/python-xmltodict).\\n\\n```sh\\n$
