        \n        \"maintainer_email\": null, \n        \"cheesecake_code_kwalitee_id\":
        null, \n        \"keywords\": null, \n        \"package_url\": \"http://pypi.python.org/pypi/pyparsing\",
        \n        \"author\": \"Paul McGuire\", \n        \"author_email\": \"ptmcg@users.sourceforge.net\",
        \n        \"download_url\": \"http://sourceforge.net/project/showfiles.php?group_id=97203\",
        \n        \"platform\": \"UNKNOWN\", \n        \"version\": \"2.2.0\", \n
        \       \"cheesecake_documentation_id\": null, \n        \"_pypi_hidden\":
        false, \n        \"description\": \"====================================\\nPyParsing
        -- A Python Parsing Module\\n====================================\\n\\nIntroduction\\n============\\n\\r\\nThe
        pyparsing module is an alternative approach to creating and executing \\r\\nsimple
        grammars, vs. the traditional lex/yacc approach, or the use of \\r\\nregular
        expressions.  The pyparsing module provides a library of classes \\r\\nthat
        client code uses to construct the grammar directly in Python code.\\r\\n\\r\\nHere
        is a program to parse \\\"Hello, World!\\\" (or any greeting of the form \\r\\n\\\"<salutation>,
        <addressee>!\\\"):\\r\\n\\r\\n    from pyparsing import Word, alphas\\r\\n
        \   greet = Word( alphas ) + \\\",\\\" + Word( alphas ) + \\\"!\\\"\\r\\n
        \   hello = \\\"Hello, World!\\\"\\r\\n    print hello, \\\"->\\\", greet.parseString(
        hello )\\r\\n\\r\\nThe program outputs the following:\\r\\n\\r\\n    Hello,
        World! -> ['Hello', ',', 'World', '!']\\r\\n\\r\\nThe Python representation
        of the grammar is quite readable, owing to the \\r\\nself-explanatory class
        names, and the use of '+', '|' and '^' operator \\r\\ndefinitions.\\r\\n\\r\\nThe
        parsed results returned from parseString() can be accessed as a \\r\\nnested
        list, a dictionary, or an object with named attributes.\\r\\n\\r\\nThe pyparsing
        module handles some of the problems that are typically \\r\\nvexing when writing
        text parsers:\\r\\n- extra or missing whitespace (the above program will also
        handle \\r\\n  \\\"Hello,World!\\\", \\\"Hello  ,  World  !\\\", etc.)\\r\\n-
        quoted strings\\r\\n- embedded comments\\r\\n\\r\\nThe .zip file includes
        examples of a simple SQL parser, simple CORBA IDL \\r\\nparser, a config file
        parser, a chemical formula parser, and a four-\\r\\nfunction algebraic notation
        parser.  It also includes a simple how-to \\r\\ndocument, and a UML class
        diagram of the library's classes.\\n\\n\\n\\nInstallation\\n============\\n\\nDo
        the usual:\\n\\n    python setup.py install\\r\\n    \\r\\n(pyparsing requires
        Python 2.6 or later.)\\n\\r\\nOr corresponding commands using pip, easy_install,
        or wheel:\\r\\n\\r\\n    pip install pyparsing\\r\\n    \\r\\n    easy_install
        pyparsing\\r\\n    \\r\\n    wheel install pyparsing\\r\\n\\n\\nDocumentation\\n=============\\n\\nSee:\\n\\n
        \   HowToUsePyparsing.html\\n\\n\\nLicense\\n=======\\n\\n    MIT License.
        See header of pyparsing.py\\n\\nHistory\\n=======\\n\\n    See CHANGES file.\\r\\n\",
