        null, \n        \"_pypi_hidden\": false, \n        \"description\": \"|PyPI|
        |Build Status| |Waffle Ready| |Gitter|\\n\\nVCR.py\\n======\\n\\n.. image::
        https://raw.github.com/kevin1024/vcrpy/master/vcr.png\\n   :alt: vcr.py\\n\\nThis
        is a Python version of `Ruby's VCR\\nlibrary <https://github.com/vcr/vcr>`__.\\n\\nSource
        code\\n  https://github.com/kevin1024/vcrpy\\n\\nDocumentation\\n  https://vcrpy.readthedocs.io/\\n\\nRationale\\n---------\\n\\nVCR.py
        simplifies and speeds up tests that make HTTP requests. The\\nfirst time you
        run code that is inside a VCR.py context manager or\\ndecorated function,
        VCR.py records all HTTP interactions that take\\nplace through the libraries
        it supports and serializes and writes them\\nto a flat file (in yaml format
        by default). This flat file is called a\\ncassette. When the relevant piece
        of code is executed again, VCR.py\\nwill read the serialized requests and
        responses from the\\naforementioned cassette file, and intercept any HTTP
        requests that it\\nrecognizes from the original test run and return the responses
        that\\ncorresponded to those requests. This means that the requests will not\\nactually
        result in HTTP traffic, which confers several benefits\\nincluding:\\n\\n-
        \ The ability to work offline\\n-  Completely deterministic tests\\n-  Increased
        test execution speed\\n\\nIf the server you are testing against ever changes
        its API, all you need\\nto do is delete your existing cassette files, and
        run your tests again.\\nVCR.py will detect the absence of a cassette file
        and once again record\\nall HTTP interactions, which will update them to correspond
        to the new\\nAPI.\\n\\nSupport\\n-------\\n\\nVCR.py works great with the
        following HTTP clients:\\n\\n-  requests\\n-  aiohttp\\n-  urllib3\\n-  tornado\\n-
        \ urllib2\\n-  boto\\n-  boto3\\n\\n\\nLicense\\n=======\\n\\nThis library
