  response:
    body: {string: "{\n    \"info\": {\n        \"maintainer\": \"\", \n        \"docs_url\":
        null, \n        \"requires_python\": \"\", \n        \"maintainer_email\":
        \"\", \n        \"cheesecake_code_kwalitee_id\": null, \n        \"keywords\":
        \"pytest mock\", \n        \"package_url\": \"http://pypi.python.org/pypi/pytest-mock\",
        \n        \"author\": \"Bruno Oliveira\", \n        \"author_email\": \"nicoddemus@gmail.com\",
        \n        \"download_url\": \"\", \n        \"platform\": \"any\", \n        \"version\":
        \"1.6.3\", \n        \"cheesecake_documentation_id\": null, \n        \"_pypi_hidden\":
        false, \n        \"description\": \"===========\\npytest-mock\\n===========\\n\\nThis
        plugin installs a ``mocker`` fixture which is a thin-wrapper around the patching
        API\\nprovided by the `mock package <http://pypi.python.org/pypi/mock>`_,\\nbut
        with the benefit of not having to worry about undoing patches at the end\\nof
        a test:\\n\\n.. code-block:: python\\n\\n    import os\\n\\n    class UnixFS:\\n\\n
        \       @staticmethod\\n        def rm(filename):\\n            os.remove(filename)\\n\\n
        \   def test_unix_fs(mocker):\\n        mocker.patch('os.remove')\\n        UnixFS.rm('file')\\n
        \       os.remove.assert_called_once_with('file')\\n\\n\\n.. Using PNG badges
        because PyPI doesn't support SVG\\n\\n|python| |version| |anaconda| |ci| |appveyor|
        |coverage|\\n\\n.. |version| image:: http://img.shields.io/pypi/v/pytest-mock.svg\\n
        \ :target: https://pypi.python.org/pypi/pytest-mock\\n\\n.. |anaconda| image::
        https://anaconda.org/conda-forge/pytest-mock/badges/version.svg\\n    :target:
        https://anaconda.org/conda-forge/pytest-mock\\n\\n.. |ci| image:: http://img.shields.io/travis/pytest-dev/pytest-mock.svg\\n
        \ :target: https://travis-ci.org/pytest-dev/pytest-mock\\n\\n.. |appveyor|
        image:: https://ci.appveyor.com/api/projects/status/pid1t7iuwhkm9eh6/branch/master?svg=true\\n
        \ :target: https://ci.appveyor.com/project/pytestbot/pytest-mock\\n\\n.. |coverage|
        image:: http://img.shields.io/coveralls/pytest-dev/pytest-mock.svg\\n  :target:
        https://coveralls.io/r/pytest-dev/pytest-mock\\n\\n.. |python| image:: https://img.shields.io/pypi/pyversions/pytest-mock.svg\\n
        \ :target: https://pypi.python.org/pypi/pytest-mock/\\n\\nUsage\\n=====\\n\\nThe
        ``mocker`` fixture has the same API as\\n`mock.patch <http://www.voidspace.org.uk/python/mock/patch.html#patch-decorators>`_,\\nsupporting
        the same arguments:\\n\\n.. code-block:: python\\n\\n    def test_foo(mocker):\\n
        \       # all valid calls\\n        mocker.patch('os.remove')\\n        mocker.patch.object(os,
        'listdir', autospec=True)\\n        mocked_isfile = mocker.patch('os.path.isfile')\\n\\nThe
        supported methods are:\\n\\n* ``mocker.patch``: see http://www.voidspace.org.uk/python/mock/patch.html#patch.\\n*
        ``mocker.patch.object``: see http://www.voidspace.org.uk/python/mock/patch.html#patch-object.\\n*
        ``mocker.patch.multiple``: see http://www.voidspace.org.uk/python/mock/patch.html#patch-multiple.\\n*
        ``mocker.patch.dict``: see http://www.voidspace.org.uk/python/mock/patch.html#patch-dict.\\n*
        ``mocker.stopall()``: stops all active patches up to this point.\\n* ``mocker.resetall()``:
        calls ``reset_mock()`` in all mocked objects up to this point.\\n\\nSome objects
        from the ``mock`` module are accessible directly from ``mocker`` for convenience:\\n\\n*
        `Mock <https://docs.python.org/3/library/unittest.mock.html#unittest.mock.Mock>`_\\n*
        `MagicMock <https://docs.python.org/3/library/unittest.mock.html#unittest.mock.MagicMock>`_\\n*
        `PropertyMock <https://docs.python.org/3/library/unittest.mock.html#unittest.mock.PropertyMock>`_\\n*
        `ANY <https://docs.python.org/3/library/unittest.mock.html#any>`_\\n* `DEFAULT
        <https://docs.python.org/3/library/unittest.mock.html#default>`_ *(Version
        1.4)*\\n* `call <https://docs.python.org/3/library/unittest.mock.html#call>`_
        *(Version 1.1)*\\n* `sentinel <https://docs.python.org/3/library/unittest.mock.html#sentinel>`_
        *(Version 1.2)*\\n* `mock_open <https://docs.python.org/3/library/unittest.mock.html#mock-open>`_\\n\\n\\nSpy\\n---\\n\\nThe
        spy acts exactly like the original method in all cases, except it allows use
        of `mock`\\nfeatures with it, like retrieving call count. It also works for
        class and static methods.\\n\\n\\n.. code-block:: python\\n\\n    def test_spy(mocker):\\n
        \       class Foo(object):\\n            def bar(self):\\n                return
        42\\n\\n        foo = Foo()\\n        mocker.spy(foo, 'bar')\\n        assert
        foo.bar() == 42\\n        assert foo.bar.call_count == 1\\n\\nStub\\n----\\n\\n\\nThe
        stub is a mock object that accepts any arguments and is useful to test callbacks,
        for instance.\\nMay be passed a name to be used by the constructed stub object
        in its repr (useful for debugging).\\n\\n.. code-block:: python\\n\\n    def
        test_stub(mocker):\\n        def foo(on_something):\\n            on_something('foo',
        'bar')\\n\\n        stub = mocker.stub(name='on_something_stub')\\n\\n        foo(stub)\\n
        \       stub.assert_called_once_with('foo', 'bar')\\n\\n\\nImproved reporting
        of mock call assertion errors\\n------------------------------------------------\\n\\n\\nThis
        plugin monkeypatches the mock library to improve pytest output for failures\\nof
        mock call assertions like ``Mock.assert_called_with()`` by hiding internal
        traceback\\nentries from the ``mock`` module.\\n\\nIt also adds introspection
        information on differing call arguments when\\ncalling the helper methods.
        This features catches `AssertionError` raised in\\nthe method, and uses py.test's
        own `advanced assertions`_ to return a better\\ndiff::\\n\\n\\n    mocker
        = <pytest_mock.MockFixture object at 0x0381E2D0>\\n\\n        def test(mocker):\\n
        \           m = mocker.Mock()\\n            m('fo')\\n    >       m.assert_called_once_with('',
        bar=4)\\n    E       AssertionError: Expected call: mock('', bar=4)\\n    E
        \      Actual call: mock('fo')\\n    E\\n    E       pytest introspection
        follows:\\n    E\\n    E       Args:\\n    E       assert ('fo',) == ('',)\\n
        \   E         At index 0 diff: 'fo' != ''\\n    E         Use -v to get the
        full diff\\n    E       Kwargs:\\n    E       assert {} == {'bar': 4}\\n    E
        \        Right contains more items:\\n    E         {'bar': 4}\\n    E         Use
        -v to get the full diff\\n\\n\\ntest_foo.py:6: AssertionError\\n==========================
        1 failed in 0.03 seconds ===========================\\n\\n\\nThis is useful
        when asserting mock calls with many/nested arguments and trying\\nto quickly
        see the difference.\\n\\nThis feature is probably safe, but if you encounter
        any problems it can be disabled in\\nyour ``pytest.ini`` file:\\n\\n.. code-block::
        ini\\n\\n    [pytest]\\n    mock_traceback_monkeypatch = false\\n\\nNote that
        this feature is automatically disabled with the ``--tb=native`` option. The
        underlying\\nmechanism used to suppress traceback entries from ``mock`` module
        does not work with that option\\nanyway plus it generates confusing messages
        on Python 3.5 due to exception chaining\\n\\n.. _advanced assertions: http://pytest.org/latest/assert.html\\n\\n\\nUse
        standalone \\\"mock\\\" package\\n-----------------------------\\n\\n*New
        in version 1.4.0.*\\n\\nPython 3 users might want to use a newest version
        of the ``mock`` package as published on PyPI\\nthan the one that comes with
        the Python distribution.\\n\\n.. code-block:: ini\\n\\n    [pytest]\\n    mock_use_standalone_module
        = true\\n\\nThis will force the plugin to import ``mock`` instead of the ``unittest.mock``
        module bundled with\\nPython 3.3+. Note that this option is only used in Python
        3+, as Python 2 users only have the option\\nto use the ``mock`` package from
        PyPI anyway.\\n\\n\\nRequirements\\n============\\n\\n* Python 2.6+, Python
        3.3+\\n* pytest\\n* mock (for Python 2)\\n\\n\\nInstall\\n=======\\n\\nInstall
        using `pip <http://pip-installer.org/>`_:\\n\\n.. code-block:: console\\n\\n
        \   $ pip install pytest-mock\\n\\nChangelog\\n=========\\n\\nPlease consult
        the `changelog page`_.\\n\\n.. _changelog page: https://github.com/pytest-dev/pytest-mock/blob/master/CHANGELOG.rst\\n\\nWhy
        bother with a plugin?\\n=========================\\n\\nThere are a number
        of different ``patch`` usages in the standard ``mock`` API,\\nbut IMHO they
        don't scale very well when you have more than one or two\\npatches to apply.\\n\\nIt
        may lead to an excessive nesting of ``with`` statements, breaking the flow\\nof
        the test:\\n\\n.. code-block:: python\\n\\n    import mock\\n\\n    def test_unix_fs():\\n
        \       with mock.patch('os.remove'):\\n            UnixFS.rm('file')\\n            os.remove.assert_called_once_with('file')\\n\\n
        \           with mock.patch('os.listdir'):\\n                assert UnixFS.ls('dir')
        == expected\\n                # ...\\n\\n        with mock.patch('shutil.copy'):\\n
        \           UnixFS.cp('src', 'dst')\\n            # ...\\n\\n\\nOne can use
        ``patch`` as a decorator to improve the flow of the test:\\n\\n.. code-block::
        python\\n\\n    @mock.patch('os.remove')\\n    @mock.patch('os.listdir')\\n
        \   @mock.patch('shutil.copy')\\n    def test_unix_fs(mocked_copy, mocked_listdir,
        mocked_remove):\\n        UnixFS.rm('file')\\n        os.remove.assert_called_once_with('file')\\n\\n
        \       assert UnixFS.ls('dir') == expected\\n        # ...\\n\\n        UnixFS.cp('src',
        'dst')\\n        # ...\\n\\nBut this poses a few disadvantages:\\n\\n- test
        functions must receive the mock objects as parameter, even if you don't plan
        to\\n  access them directly; also, order depends on the order of the decorated
        ``patch``\\n  functions;\\n- receiving the mocks as parameters doesn't mix
        nicely with pytest's approach of\\n  naming fixtures as parameters, or ``pytest.mark.parametrize``;\\n-
        you can't easily undo the mocking during the test execution;\\n\\n\\n**Note
        about usage as context manager**\\n\\nAlthough mocker's API is intentionally
        the same as ``mock.patch``'s, its use\\nas context manager and function decorator
        is **not** supported through the\\nfixture. The purpose of this plugin is
        to make the use of context managers and\\nfunction decorators for mocking
        unnecessary. Indeed, trying to use the\\nfunctionality in ``mocker`` in this
        manner can lead to non-intuitive errors:\\n\\n.. code-block:: python\\n\\n
        \   def test_context_manager(mocker):\\n        a = A()\\n        with mocker.patch.object(a,
        'doIt', return_value=True, autospec=True):\\n            assert a.doIt() ==
        True\\n\\n.. code-block:: console\\n\\n    ==================================
        FAILURES ===================================\\n    ____________________________
        test_context_manager _____________________________\\n    in test_context_manager\\n
        \       with mocker.patch.object(a, 'doIt', return_value=True, autospec=True):\\n
        \   E   AttributeError: __exit__\\n\\nYou can however use ``mocker.mock_module``
        to access the underlying ``mock``\\nmodule, e.g. to return a context manager
        in a fixture that mocks something\\ntemporarily:\\n\\n.. code-block:: python\\n\\n
        \   @pytest.fixture\\n    def fixture_cm(mocker):\\n        @contextlib.contextmanager\\n
        \       def my_cm():\\n            def mocked():\\n                pass\\n\\n
        \           with mocker.mock_module.patch.object(SomeClass, 'method', mocked):\\n
        \               yield\\n        return my_cm\\n\\n\\nLicense\\n=======\\n\\nDistributed
        under the terms of the `MIT`_ license.\\n\\n.. _MIT: https://github.com/pytest-dev/pytest-mock/blob/master/LICENSE\\n\\n\\n\",
        \n        \"release_url\": \"http://pypi.python.org/pypi/pytest-mock/1.6.3\",
        \n        \"downloads\": {\n            \"last_month\": 0, \n            \"last_week\":
        0, \n            \"last_day\": 0\n        }, \n        \"_pypi_ordering\":
        24, \n        \"requires_dist\": [\n            \"mock; python_version==\\\"2.6\\\"
        or python_version==\\\"2.7\\\"\", \n            \"pytest (>=2.7)\"\n        ],
