    body: {string: "{\n    \"info\": {\n        \"maintainer\": null, \n        \"docs_url\":
        null, \n        \"requires_python\": null, \n        \"maintainer_email\":
        null, \n        \"cheesecake_code_kwalitee_id\": null, \n        \"keywords\":
