        \n        \"download_url\": \"UNKNOWN\", \n        \"platform\": \"UNKNOWN\",
        \n        \"version\": \"2.0.0\", \n        \"cheesecake_documentation_id\":
        null, \n        \"_pypi_hidden\": false, \n        \"description\": \"mock
        is a library for testing in Python. It allows you to replace parts of\\nyour
        system under test with mock objects and make assertions about how they\\nhave
        been used.\\n\\nmock is now part of the Python standard library, available
        as `unittest.mock\\n<https://docs.python.org/dev/library/unittest.mock.html>`_
        in Python 3.3\\nonwards.\\n\\nThis package contains a rolling backport of
        the standard library mock code\\ncompatible with Python 2.6 and up, and 3.3
